import React from 'react';
import Navbar from 'react-bootstrap/Navbar';

export default class Nav extends React.Component<any,any> {
  constructor(props:any){
    super(props);
  }
  render(){
    return(
      <Navbar>
        Navbar goes here. Current page: { this.props.current }
      </Navbar>
    )
  }
}
